import React from 'react';
import PropType from 'prop-types';

const AppLayout = ({ children }) => {
  return (
    <>
      <div>공동메뉴</div>
      {children}
    </>
  );
};

AppLayout.propTypes = {
  children: propTypes.node.isReactive,
};

export default AppLayout;
